MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "A chemical mechanical polishing (CMP) model is a model used to predict chip surface topography (heights or positions) for layouts and test structures at various stages in the manufacturing process. The primary use for this model is to predict erosion and dishing effects after CMP. A CMP model is also known as a process recipe file.");
MGCAddSnippet(6, "Planarization, or achieving a flat surface, is the physical goal of CMP. CMP modeling allows design and manufacturing teams to find potential planarization issues before manufacturing.");
MGCAddSnippet(7, "CMP models are created by Calibre CMP Model Builder (a tool available in the CalibreWORKbench platform) as described in this manual. Calibrated CMP models are used along with your design in Calibre CMPAnalyzer to predict problems such as hot spots. ");
MGCAddSnippet(8, "Before you begin using CMP Modeling, you need to know some basic types of objects you will be working with.");
MGCAddSnippet(9, "Before using CMP Modeling, you need to have a number of required files and parameters in order to create a fully-functional model.");
MGCAddSnippet(10, "You can run CMP Model Builder either in the Calibre WORKbench GUI (recommended) or as a batch command. The GUI provides fields to produce the initial process recipe file and measured data file. The CMP Model Builder batch method is suitable for running several slightly different simulations after the initial setup.");
MGCAddSnippet(11, "The Calibre WORKbench GUI hosts the CMP Model Builder interface. The GUI prompts you for required values when setting up measurements and CMP recipes.");
MGCAddSnippet(12, "The CMP Model Builder batch method is suitable for running several slightly different simulations after the initial setup. ");
MGCAddSnippet(13, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(14, "A CMP model is also known as a process recipe file. After creating the CMP model, creating a measured data file is required for optimizing the model.");
MGCAddSnippet(15, "Process recipe files provide the initial information for optimizing a CMP model. Use the Calibre WORKbench CMP Model Builder tool to create a process recipe file.");
MGCAddSnippet(16, "You can create a process recipe file in Calibre WORKbench based on the information about the manufacturing process. This method is recommended as the GUI checks each command after entry.");
MGCAddSnippet(17, "When creating process recipes you need to be aware of the default units for the values you specify.");
MGCAddSnippet(18, "This example uses a 2D mask and six measurement sites. There are three CMP models, one for each platen. After the recipe is an illustration showing how the keywords map to actual manufacturing steps.");
MGCAddSnippet(19, "MD files contain thickness information about your test structures and patterns after they have gone through the manufacturing process. The MD file has up to 34 columns that contain simulation and measurement values. ");
MGCAddSnippet(20, "Measured data files (MD file, also called an MD table (MDT)) are required for the initial optimization runs. The initial file includes only the measured data and is based on the test layout.");
MGCAddSnippet(21, "Line scans show erosion and dishing values. They are created by examining test chips with microscopes. The information may be stored as either a spreadsheet of values or as a plot saved in a graphical format file. You can import the spreadsheet into the CMP Model Builder tool and have the information appear in the MD file.");
MGCAddSnippet(22, "Calibration involves optimizing the different parameters. You indicate the ones to optimize by using symbolic names. This can be done for the mask, ECD, and CMP model parameters. ");
MGCAddSnippet(23, "After a successful optimization attempt, you analyze data plots to isolate outlier data points that might skew the model accuracy. Group measured and simulated values together for analysis.");
MGCAddSnippet(24, "You should check the optimization results to tune your model. The results are in the grid files. The CMP Model Builder GUI allows you to view the results and compare simulated versus measured values in plots.");
MGCAddSnippet(25, "After optimizing your model, validate it against a production design by comparing the simulation results to measurements on the production chip. To validate, package the model and use it in Calibre CMPAnalyzer. ");
MGCAddSnippet(26, "CMP Model Builder can be invoked in batch mode or through the GUI in Calibre WORKbench. ");
MGCAddSnippet(27, "Runs simulations and returns the RMS error of the simulated versus measured data.");
MGCAddSnippet(28, "This chapter discusses the modeling commands for the process recipe file and the MD file. ");
MGCAddSnippet(29, "Symbolic names are parameter values represented as variables. ");
MGCAddSnippet(30, "Parameter values may contain expressions that use symbolic names, for example, ($HEX+$SF)*2, or references to the MD such as $X or $M_THICK (measured thickness). In each simulation, the current value of the symbolic name is used to evaluate the expression.");
MGCAddSnippet(31, "Measured data (MD) files are spreadsheet-style ASCII files for storing measured and simulated data. They are required file for CMP model optimization. The file browser assumes a suffix of .dat, but this is not required.");
MGCAddSnippet(32, "The process recipe file contains commands describing the process steps your silicon goes through in the manufacturing process. ");
MGCAddSnippet(33, "Defines a polishing step to be used within the recipe for a copper or oxide layer. ");
MGCAddSnippet(34, "Defines a 1D mask in terms of a series of sections defined by their lengths, widths, and spaces.");
MGCAddSnippet(35, "Defines a 2D mask array of test structures defined by their lengths, widths, and spaces.");
MGCAddSnippet(36, "Creates a model of an ECD or CMP process. ");
MGCAddSnippet(37, "Introduces a new layer at the top of the layer stack. If the material for this deposit command is the same as the material for the previous deposit command, the command only modifies the surface position and does not add a new layer.");
MGCAddSnippet(38, "Defines a trench etching step.");
MGCAddSnippet(39, "Required. Defines the limits of the simulation domain with X1, Y1, X2, Y2. By default, initialize spans the extent of the loaded layout file or the extent of the define_mask definition.");
MGCAddSnippet(40, "Saves files containing data on grids for graphing in later stages.");
MGCAddSnippet(41, "This chapter contains a dictionary of environment variables that can be used with CMP modeling. Environment variables are not saved as part of session files or recipe files. If you intend to use a particular setting across multiple sessions, set the environment variables in a shell script used to invoke Calibre WORKbench or run the cmpoptimize command. ");
MGCAddSnippet(42, "Controls which form of extraction is used.");
MGCAddSnippet(43, "Causes the OpenAreaFraction and polishing time to be reported.");
MGCAddSnippet(44, "Enables modified handling for metal shapes that are larger than the frame. ");
MGCAddSnippet(45, "Turns on an extraction version optimized for many small shapes such as metal fill.");
MGCAddSnippet(46, "Sets the extraction version.");
MGCAddSnippet(47, "Uses the second-generation erosion definition.");
MGCAddSnippet(48, "Defines the range of minimal pattern density values for calculating erosion. ");
MGCAddSnippet(49, "Sets the version of CMP Model Builder. ");
MGCAddSnippet(50, "Controls how SThickNT is calculated. ");
MGCAddSnippet(51, "Uses the first-generation erosion definition. ");
MGCAddSnippet(52, "This chapter describes the function of the major menus, tabs, and secondary dialog boxes. Common dialog boxes such as the file browser are not listed. ");
MGCAddSnippet(53, "Use this tool window to set up CMP recipes, weight data, and analyze simulation results.");
MGCAddSnippet(54, "Use this tab to input SEM or AFM measurement data (the measured values in the MD file) and apply weighting to individual measurements.");
MGCAddSnippet(55, "Use this dialog box to sort and order measured data when reviewing your CMP measured data table.");
MGCAddSnippet(56, "Use this dialog box to create plots that can be used when analyzing your CMP models. ");
MGCAddSnippet(57, "Use this tab to create a process recipe file. ");
MGCAddSnippet(58, "Use this dialog box to set up or edit the initialize command in a process recipe.");
MGCAddSnippet(59, "Use this dialog box to set up or edit an etch command in a process recipe. ");
MGCAddSnippet(60, "Use this dialog box to set up or edit deposit commands.");
MGCAddSnippet(61, "Use this dialog box to set up or edit cmp commands.");
MGCAddSnippet(62, "Use this dialog box to set up or edit a save command in a process recipe file. This dialog box is not used for saving sessions or process recipes.");
MGCAddSnippet(63, "Use this dialog box to set up or edit the parameters for an ECD define_model command.");
MGCAddSnippet(64, "Use this dialog box to set up or edit the parameters for a CMP define_model command.");
MGCAddSnippet(65, "Use this dialog box to set up or edit a lookup table to use for non-constant parameter values.");
MGCAddSnippet(66, "Use this dialog box to set up a 1-dimensional (linear) mask.");
MGCAddSnippet(67, "Use this dialog box to set up a two-dimensional mask; that is, a mask in which the test structures form a grid. For Mask2D, expanding the dialog box reveals additional columns in the table data but does not expose more fields or controls.");
MGCAddSnippet(68, "Use this dialog box to add expressions that populate the measured data table with calculated values. The expression can be used as an optimization parameter. The value computed by the expression is considered to be a simulated value.");
MGCAddSnippet(69, "Use this interface to adjust optimization runs and view the results. If you click the + button in the upper right corner of the window, additional controls are displayed. ");
MGCAddSnippet(70, "Use this tab to view the contents of remote configuration files and set the run to be distributed (MTflex or MTflex in hyperscaling mode).");
MGCAddSnippet(71, "Use this tab to view and modify saved data from a simulation. If you click the + button in the upper right of the window, additional controls are displayed.");
MGCAddSnippet(72, "The file examples in this appendix demonstrate preferred style. As every semiconductor manufacturing process is proprietary, all values used are fictitious. The files can serve as templates for your calibration but do not attempt to preserve the values.");
MGCAddSnippet(73, "The four file examples are provided for illustrative purposes only. They do not represent a real foundry s process.");
MGCAddSnippet(74, "Expression-based optimizations work differently from typical multi-parameter optimizations. A major difference is that the recipe must contain only the expression step.");
MGCAddSnippet(75, "Although Calibre WORKbench plots can show a surface plot, many engineers are more comfortable with other graphing software. The CMP Model Builder GUI can save standard surface grids in a tabular form that is easily viewed in MathWorksMATLAB, gnuplot, Octave, or other plotting tools.");
MGCAddSnippet(76, "There are many components of a CMP model and it is imperative to know how they fit together. Some files are required inputs for an optimization run. ");
MGCAddSnippet(77, "CMP models are required for running Calibre CMPAnalyzer. ");
MGCAddSnippet(78, "Layouts used in CMP Model Builder should be flat (non-hierarchical) and in GDS or OASIS format. ");
MGCAddSnippet(79, "MD files contain thickness information about your test structures and patterns after they have gone through the manufacturing process. The MD file has up to 34 columns that contain simulation and measurement values. ");
MGCAddSnippet(80, "A mask is an automatically generated pattern for a test chip. Based on parameters you provide, it generates sets of trenches (arrays) laid out in a one-dimensional (1D) or two-dimensional (2D) pattern.");
MGCAddSnippet(81, "A snapshot is a set of grids that represents the current state of the simulation. Snapshots track the surface position and pressure of a CMP simulation at specified times or after a process step. These grids can be displayed in CMP Model Builder. ");
MGCAddSnippet(82, "Once a simulation (or optimization) run is started, layout data is read into CMP Model Builder and mask data is extracted and stored into grids. ");
MGCAddSnippet(83, "Grid files are generated from simulations in CMP Model Builder. ");
MGCAddSnippet(84, "When the test chip is large (either wider than a centimeter on one side, or when there are billions of shapes), it is faster to use Calibre CMPAnalyzer to extract the grid file and then load it into CMP Model Builder than it is to use CMP Model Builder directly because Calibre CMPAnalyzer supports multithreading.");
MGCAddSnippet(85, "The simulation grids are regular grids of a user-specified size (typically 20 um x 20 um) that divides the simulation area into uniform regions. ");
MGCAddSnippet(86, "After calibration runs have been completed and meet your specifications, the optimized model along with the best values for your parameters are located in the directory specified in Outdir. The optimized model has the .in file extension.");
MGCAddSnippet(87, "A CMP Model is composed of various theoretical models that are used by the CMP Optimization tool.");
MGCAddSnippet(88, "The CMP model is an overall model used for optimizing parameters related to the CMP step. It has several interacting submodels.");
MGCAddSnippet(89, "The deposit models consist of several different ways of describing how fast material appears on the surface and how it fills in the trenches.");
MGCAddSnippet(90, "");
MGCAddSnippet(91, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

